import React, { useState, useContext } from 'react';
import './Navbar.css';
import logobranco from '../Assets/logo-branco.png';
import cart_icon from '../Assets/icone-carrinho.png';
import search_icon from '../Assets/icone-search.png';
import profile_icon from '../Assets/icone-conta.png';
import menu_icon from '../Assets/menu-hamburguer.png';
import close_icon from '../Assets/close-icon.png';
import { Link } from 'react-router-dom';
import { CartContext } from '../../../Context/CartContext';

const Navbar = () => {
  const { cartItems } = useContext(CartContext);
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <>
      <div className="navbar">
        <div className="nav-left">
          <img src={logobranco} alt="Logo Bebecê" className="nav-logo" />
          {/* Exibe apenas no mobile */}
          <img
            src={menu_icon}
            alt="Menu"
            className="mobile-menu-icon mobile-only"
            onClick={toggleMobileMenu}
          />
        </div>
        <ul className="nav-menu desktop-only">
          <li className="dropdown">
            Produtos
            <div className="dropdown-menu">
              <div className="dropdown-categories">
                <div className="category-item">Sapatos</div>
                <div className="category-item">Scarpins</div>
                <div className="category-item">Sandálias</div>
                <div className="category-item">Botas</div>
              </div>
            </div>
          </li>
          <li>
            <Link to="#lancamentos">Lançamentos</Link>
          </li>
          <li>
            <Link to="outlet">Outlet</Link>
          </li>
        </ul>
        <div className="nav-right">
          <img src={search_icon} alt="Pesquisa" className="nav-icon" />
          <Link to="perfil">
            <img src={profile_icon} alt="Perfil" className="nav-icon" />
          </Link>
          <Link to="/carrinho">
            <div className="nav-cart">
              <img src={cart_icon} alt="Carrinho" className="nav-icon" />
              {cartItems.length > 0 && <span className="cart-count">{cartItems.length}</span>}
            </div>
          </Link>
        </div>
      </div>

      {/* Mobile Menu */}
      {isMobileMenuOpen && (
        <div className="mobile-menu">
          <img
            src={close_icon}
            alt="Fechar"
            className="close-icon"
            onClick={toggleMobileMenu}
          />
          <ul className="mobile-menu-list">
            <li>
              <Link to="#lancamentos" onClick={toggleMobileMenu}>Lançamentos</Link>
            </li>
            <li>
              <Link to="outlet" onClick={toggleMobileMenu}>Outlet</Link>
            </li>
            <li>
              <Link to="botas" onClick={toggleMobileMenu}>Botas</Link>
            </li>
            <li>
              <Link to="tenis" onClick={toggleMobileMenu}>Tênis</Link>
            </li>
          </ul>
        </div>
      )}
    </>
  );
};

export default Navbar;
